import React, { Component } from "react";
import './styles/home.less';


class Home extends Component {
  // constructor(props) {
  //

  render() {
    if(document.querySelector(".chubsy-wrapper-nav") != undefined) {
      document.querySelector(".chubsy-wrapper-nav").style.backgroundColor = "rgba(255, 255, 255, 0.6)";
    }
    return (
      <div className="home-wrapper">
      </div>
    );
  }
}

export default Home;
